import React from "react";


function FooterNote() {
  return (
    <>
      Raffle lucky draw online tool created to select random winners much
      easier. Randomizing a winner is now easier than ever! Random picker,
      raffle, draw, contest.

    </>
  );
}

export default FooterNote;
